import logo from './logo.svg';
import './App.css';
import {Route, Routes} from "react-router-dom";

import Notfound from './components/Not_found';

import Hello from './components/Hello';
import Message from './components/Message';

function App() {
  return (
    <div className="App">
      <Hello></Hello>
      <Message />
      <Notfound />
    </div>
  );
}

export default App;
